import React from 'react';

function ViewTodo({ todo }) {
    console.log(todo)

    return (
        <div className=' grid grid-cols-3 p-5'>
            {
                todo.map((item, index) => {
                    return (
                        <div key={index} className=' border shadow-md p-5 m-2'>
                            <h2>{item.name}</h2>
                            <p>{item.email}</p>
                            <p>{item.task}</p>
                            <div className=' flex justify-around'>
                                <button className=' bg-red-400 px-4 py-2 border rounded-md shadow-md'>Delete</button>
                                <button className=' bg-yellow-400 px-4 py-2 border rounded-md shadow-md'>Edit</button>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    );
}

export default ViewTodo;
